    false,nt"url": null,nt"notes": "This dataset contains oceanographic data
    collected in the waters just outside of Papahanaumokuakea Marine National Monument
    (PMNM) in the Northwestern Hawaiian Islands, along the transit from Midway to Kwajalein
    in the Marshall Islands. Operations for this cruise included ROV, mapping, telepresence-based
    remote participation, and CTD rosette operations. The shipu00e2u0080u0099s deep
    water mapping systems were used, as well as NOAAu00e2u0080u0099s two-body 6000 m
    remotely operated vehicle, CTD rosette, and high-bandwidth satellite connection
    for real-time ship to shore communications. Daytime ROV dives included high-resolution
    visual surveys and limited rock and biologic specimen sampling. Exploration operations
    focused on deep-water areas around the Northwestern Hawaiian Islands, and will help
    establish a baseline of information in the region to catalyze further exploration,
    research, and management activities.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
